description:
Verenigde Staten
Animatie / Avontuur

geregisseerd door Matthew O Callaghan en Todd Wilderman

Na hals over kop verliefd te worden op Gisele, neemt Elliots weg naar het altaar een onverwachte wending wanneer Mr. Weenie gekidnapt wordt door een bende verwende huisdieren, vastberaden om hem terug naar zijn eigenaars te brengen. Boog, Elliot, McSquizzy, Buddy en de rest van de Woodland-inwoners zetten een grote reddingsactie op poten voor hun worstvormige vriend en bevinden zich al snel in het kamp van de vijand de wereld van de huisdieren. 
Aangevoerd door een minipoedel genaamd Fifi is het leger huisdieren niet van plan Mr. Weenie zonder slag of stoot te laten gaan.
Verslaat een minipoedel echt een Grizzly.
Zal Elliot ooit met Giselle trouwen

